	@Inject
	public DslGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pModel = new ModelElements();
		this.pAction = new ActionElements();
		this.pDecision = new DecisionElements();
		this.pProject = new ProjectElements();
		this.pEString = new EStringElements();
		this.pTarget = new TargetElements();
		this.pTask = new TaskElements();
		this.pFile = new FileElements();
		this.pProperty = new PropertyElements();
		this.pAction_Impl = new Action_ImplElements();
		this.pInstructionBlock = new InstructionBlockElements();
		this.pDecision_Impl = new Decision_ImplElements();
		this.pClosureBackedAction = new ClosureBackedActionElements();
		this.pDefaultAction = new DefaultActionElements();
		this.pCustomAction = new CustomActionElements();
		this.pStart = new StartElements();
		this.pEnd = new EndElements();
		this.pInstruction = new InstructionElements();
		this.pIfDecision = new IfDecisionElements();
		this.pWhileDecision = new WhileDecisionElements();
		this.pLoopDecision_Impl = new LoopDecision_ImplElements();
		this.pCondition = new ConditionElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("pt.isep.edom.xtext.assignment1.Dsl".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
